import React, { Component } from 'react'

export class Tabs extends Component {

    render() {
        return (
            <div>

                    <ul>
                        <li type>a</li>
                        <li>b</li>
                        <li>c</li>
                        <li>d</li>
                        <li>e</li>
                    </ul>

            </div>
        )
    }
}

export default Tabs
